if ($(window).width() > 1000) {
    






  
            var cursor = $(".cursor"),
                follower = $(".cursor-follower");

            var posX = 0,
                posY = 0,
                mouseX = 0,
                mouseY = 0;

            TweenMax.to({}, 0.016, {
                repeat: -1,
                onRepeat: function() {
                    posX += (mouseX - posX) / 9;
                    posY += (mouseY - posY) / 9;

                    TweenMax.set(follower, {
                        css: {
                            left: posX - 20,
                            top: posY - 20
                        }
                    });

                    TweenMax.set(cursor, {
                        css: {
                            left: mouseX,
                            top: mouseY
                        }
                    });
                }
            });

            $(document).on("mousemove", function(e) {
                mouseX = e.pageX;
                mouseY = e.pageY;
            });

            $(".demo-img-first,.demo-img-second,.pages-section__swiper span img,.card-box__poster,.allpages-iteam").on("mouseenter", function() {
                cursor.addClass("active");
                follower.addClass("active");
            });

            $(".demo-img-first,.demo-img-second,.pages-section__swiper span img,.card-box__poster,.allpages-iteam").on("mouseleave", function() {
                cursor.removeClass("active");
                follower.removeClass("active");
            });

        
}

